what-details-are-required-about-tv-broad.body:
Comme décrit dans CBD-01, section 7.1.1, les informations suivantes sont nécessaires pour les stations de télévision:

7.1.1 Renseignements nécessaires pour les stations de télévision
Une base de données d’espaces blancs doit obtenir les renseignements suivants de la base de données d’ ISED Canada concernant les stations de radiodiffusion à protéger des dispositifs d’espaces blancs :

les coordonnées de l’émetteur (latitude et longitude);
la p.a.r. maximale (Max. ERP);
la hauteur AGL du centre de rayonnement de l’antenne émettrice;
la hauteur du sol AMSL (Ground elevation AMSL)
le diagramme de rayonnement horizontal de l’antenne (si l’antenne est directionnelle);
les numéros de canaux;
l’indicatif d’appel de la station (call sign); and
l’état de la station.

what-information-are-required-for-rrbs-b.body:
Comme décrit dans [CBD-01, section 7.1.2] (http://www.ic.gc.ca/eic/site/smt-gst.nsf/fra/sf10928.html#s7.1), les informations suivantes sont requises pour les stations de base de SLBRRE (RRBS):

7.1.2 Renseignements nécessaires pour les stations de base de SLBRRE
Une base de données d’espaces blancs doit obtenir les renseignements suivants de la base de données de ISED Canada concernant les stations de SLBRRE à protéger des dispositifs d’espaces blancs :

les coordonnées de l’émetteur (latitude et longitude);
la p.a.r. maximale (Maximum ERP);
la hauteur AGL du centre de rayonnement de l’antenne émettrice;
la hauteur du site AMSL;
le diagramme de rayonnement de l’antenne d’émission (horizontal ou vertical);
les numéros de canaux (autant en aval (émission) qu’en amont (réception)); 
l’indicatif d’appel de la station.

what-information-is-required-for-low-pow.body:
Comme décrit dans [CBD-01, section 7.1.3] (http://www.ic.gc.ca/eic/site/smt-gst.nsf/fra/sf10928.html#s7.1), les informations suivantes sont requises pour les Dispositif de faible puissance (DFP) (Low-power apparatus, LPA):

7.1.3 Renseignements nécessaires pour les dispositifs à faible puissance

>

Une base de données d’espaces blancs doit obtenir les renseignements suivants de la base de données d’Industrie Canada concernant les stations de DFP dont l’enregistrement et l’horaire sont acceptés:

les coordonnées (latitude et longitude);
le type (fixe ou JE) (fixed or ENG-type);
le rayon d’exploitation (si de type JE);
la fréquence d’exploitation (si de type fixe).

what-information-is-required-for-fixed-w.body:
7.2.1 Enregistrement des dispositifs d’espaces blancs fixes
Une base de données d’espaces blancs doit comporter une fonction d’enregistrement des utilisateurs de dispositifs d’espaces blancs fixes qui la consultent. Les renseignements pertinents doivent être récoltés auprès des utilisateurs afin de faciliter les enquêtes en cas de brouillage préjudiciable.
Une base de données d’espaces blancs doit obtenir les renseignements suivants de la part des utilisateurs de dispositifs d’espaces blancs fixes:

le nom de la personne ou de l’entreprise à qui appartient le dispositif (soit le fournisseur de services Internet [FSI], et non ses clients);
le nom de la personne ressource responsable de régler les problèmes de brouillage liés à l’utilisation du dispositif;
l’adresse postale de la personne ressource;
l’adresse courriel valide de la personne ressource;
le numéro de téléphone de la personne ressource.

L’enregistrement de l’information est considéré comme étant public.
Avant d’enregistrer un dispositif d’espaces blancs pour la première fois, la base de données d’espaces blancs doit vérifier que les renseignements ci-dessus sont complets et que l’utilisateur du dispositif fixe a fourni une adresse de courriel confirmée.



Informations ci-dessus extraites de CBD-01 at http://www.ic.gc.ca/eic/site/smt-gst.nsf/fra/sf10928.html#s7.2.1

what-information-is-required-to-register.body:
7.2.2 Enregistrement de sites de récepteurs de télévision et de têtes de ligne de câblodistribution
Une base de données d’espaces blancs doit offrir un procédé d’enregistrement des sites de récepteurs de télévision admissibles à la protection décrite à la Section 7.2.1.
Une base de données d’espaces blancs (WSDB) doit obtenir les renseignements d’enregistrement suivants des utilisateurs de sites de récepteurs de télévision souhaitant (TVRX) être protégés des dispositifs d’espaces blancs (WSDs):

les noms des personnes ou des entreprises responsables de chaque site de récepteurs de télévision (TVRX);
les adresses des personnes ressources;
les adresses de courriel valides des personnes ressources;
les numéros de téléphone des personnes ressources;
les coordonnées de l’emplacement du site de récepteurs de télévision;
les canaux reçus au site de récepteurs de télévision et leur indicatif d’appel;
l’indicatif d’appel de l’émetteur associé au site de récepteurs de télévision ou le numéro d’opération de têtes de lignes de câblodistribution.

Les enregistrements seront considérés comme étant publics.
Une base de données d’espaces blancs doit vérifier que le site de récepteurs de télévision enregistré est associé à un indicatif d’appel autorisé par Industrie Canada.
Une base de données d’espaces blancs doit vérifier que la tête de ligne de câblodistribution ou le site de récepteurs de télévision enregistré n’est pas à plus de 80 km du côté le plus proche d’un contour de protection associé.
Si les renseignements ne peuvent être confirmés, la base de données d’espaces blancs doit rejeter l’enregistrement et afficher un message indiquant de communiquer avec Industrie Canada pour obtenir une demande d’autorisation.



Informations ci-dessus extraites de CBD-01 at http://www.ic.gc.ca/eic/site/smt-gst.nsf/fra/sf10928.html#s7.2.2

what-information-is-required-for-lpa-sch.body:
7.2.3 Renseignements concernant l’horaire d’utilisation des DFP
Une base de données d’espaces blancs doit comporter une fonction permettant aux utilisateurs de DFP d’enregistrer les renseignements concernant l’horaire d’utilisation et l’emplacement des DFP.
a) Une base de données d’espaces blancs doit obtenir les renseignements suivants, concernant l’horaire d’utilisation, de la part des utilisateurs de DFP sous licence souhaitant être protégés des dispositifs d’espaces blancs :

le nom de la personne ou de l’entreprise responsable du DFP;
l’adresse de la personne ressource;
l’adresse de courriel valide de la personne ressource;
le numéro de téléphone de la personne ressource;
les coordonnées géographiques (NAD83) de l’emplacement ou des zones d’exploitation du DFP;
les canaux de télévision utilisés par le DFP aux sites indiqués (Dans le cas des DFP utilisés de façon fixe, la base de données d’espaces blancs ne doit permettre que l’enregistrement des fréquences précisées dans la licence. Cette vérification n’est pas nécessaire dans le cas des DFP de type JE.)
les heures, les jours, les semaines et/ou les mois précis où le DFP sera utilisé (il est à noter que le site ne sera pas protégé contre les dispositifs d’espaces blancs les jours où le DFP ne sera pas utilisé);
le numéro de licence du DFP.

(b) Concernant l’élément (a.5) ci-dessus, les paramètres suivants devraient être pris en compte :

la zone d’exploitation d’un DFP peut se définir comme zone déterminée par un point et un rayon ou comme un quadrilatère; plusieurs enregistrements peuvent être faits pour indiquer plusieurs points dans les installations de très grands sites;
dans le cas d’une zone déterminée par un point et un rayon, les emplacements d’exploitation des DFP peuvent être définis par un maximum de 25 points géographiques à la fois, chacun ayant un rayon d’exploitation maximal de 500 mètres;
dans le cas d’un quadrilatère, les emplacements d’exploitation des DFP peuvent être définis par des lignes droites reliant les sommets (points géographiques) du quadrilatère :

chaque quadrilatère doit être constitué de quatre points géographiques et la distance maximale entre deux points adjacents doit être de 3 km,



si des DFP couvrent une zone plus grande, jusqu’à quatre quadrilatères non contigus peuvent être enregistrés.





Il est possible d’effectuer l’enregistrement de DFP en ligne en accédant directement aux bases de données d’espaces blancs désignées, comme l’indique la page Web suivante de ISED Canada: http://www.ic.gc.ca/eic/site/smt-gst.nsf/fra/h_sf10498.html.
(c) Une base de données d’espaces blancs doit vérifier que le DFP essayant d’y enregistrer son horaire d’utilisation possède une licence valide selon la base de données d’Industrie Canada. Si ce n’est pas le cas, elle doit rejeter l’enregistrement du DFP et envoyer un message indiquant de communiquer avec Industrie Canada pour obtenir une licence.
(d) Tous les enregistrements sont considérés comme étant publics.



Informations ci-dessus extraites de CBD-01 at http://www.ic.gc.ca/eic/site/smt-gst.nsf/fra/sf10928.html#s7.2.3

